  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes marshbird callback
  survey results for 2000.  Last year's selection of points based on three mini-surveys
  was used as the basis of the route chosen for this year's survey. A series of 18
  points from those three surveys was chosen to give a continuous series of points
  along the refuge impoundments. Two sites were rejected as having too much woods.
  The 18 sites on the 2000 survey began just south of the headquarters complex, proceeded
  along the west dike past the entrance to False Cape State Park, and came back along
  the east dike with one site on the south cross dike.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
